import About from '../pages/about';

export default function Footer() {
  const social = css`
    width: 50%;
    float: right;
    font-family: 'Karla', sans-serif;
  `;

  const face = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: lightblue;
    font-size: 16px;
    width: 20%;
  `;

  const tweet = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: blue;
    font-size: 16px;
    width: 20%;
  `;

  const support = css`
    float: left;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: green;
    font-size: 0.8em;
    width: 40%;
  `;

  const linked = css`
    float: right;
    line-height: 70px;
    text-decoration: none;
    color: white;
    text-align: center;
    font-weight: bold;
    background-color: pink;
    font-size: 20%px;
    width: 20%;
  `;

  const paragh = css`
    padding-left: 3%;
    color: white;
    font-size: 14px;
    letter-spacing: 1px;
  `;

  const copyright = css`
    width: 50%;
    float: left;
    font-family: 'Karla', sans-serif;
    margin-top: 10px;
    margin-bottom: 10px;
  `;

  const footer = css`
    width: 100%;
    display: inline-block;
    margin: 2em 0;
    height: 70px;
    background-color: #999;
    position: absolute;
    bottom: 0;
    height: 2.5rem;
  `;

  return (
    <>
      <style>
        @import
        url('https://fonts.googleapis.com/css2?family=Major+Mono+Display&display=swap');
      </style>
      <footer css={footer}>
        <div css={copyright}>
          <p css={paragh}>&copy; 2020 - SÃ¡nchez</p>
        </div>
        <div css={social}>
          <a href="#a" css={support}>
            Contact Us
          </a>
          <a href="#a" css={face}>
            f
          </a>
          <a href="#a" css={tweet}>
            t
          </a>
          <a href="#a" css={linked}>
            in
          </a>
        </div>
      </footer>
    </>
  );
}
